import styled from "../assets/styles";
import { theme } from '../assets/styles/mainStyles';

export const Box = styled.div`
    position: absolute;
    width: 329px;
    height: 174px;
    background: #FFFFFF;
    border-radius: 10px;
    h3 {
        position: absolute;
        width: 212px;
        height: 34px;

        font-family: Montserrat;
        font-style: normal;
        font-weight: 800;
        font-size: 18px;
        line-height: 22px;
        text-align: center;
        color: ${theme.colors.primary};
    }
`
